import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import axios from 'axios'

axios
  .get('http://localhost:3001/books')
  .then(response => {
    const books = response.data
    console.log(books)
  })


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
